import './App.css';

function App() {
  const onSubmit=(e) => {
    e.preventDefault();
  }
  return (
    <div className="App">
     <form onSubmit={onSubmit}>
      <input type="text" name="avtar"/>
      <input type="text"name="furious"/>
      <input type="submit" value="submit"/>
     </form>
    </div>
  );
}

export default App;
